            name: "",
            description: ""
        }
    ];

    return(
        <div>
            <h1>EXPERIENCE</h1>
            <Navbar second_btn={0} third_btn={1} fourth_btn={2} />
            <table className="table1">
                {
                    work.map((val, key) => {
                        return(
                            <tr key={key}>
                                <td>{val.year}</td>
                                <td>{val.place}</td>
                                <td>{val.description}</td>
                            </tr>
                        )
                    })
                }
            </table>

            <table className="table1">
                {
                    education.map((val, key) => {
                        return(
                            <tr key={key}>
                                <td>{val.year}</td>
                                <td>{val.place}</td>
                                <td>{val.description}</td>
                            </tr>
                        )
                    })
                }
            </table>
        </div>
    );
}

export default Experience;
